import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AppointmentList = () => {
    const [appointments, setAppointments] = useState([]);

    useEffect(() => {
        const fetchAppointments = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/appointments');
                setAppointments(response.data);
            } catch (error) {
                console.error('Error fetching appointments:', error);
            }
        };
        fetchAppointments();
    }, []);

    return (
        <div className="p-6 bg-white rounded-lg shadow-md">
            <h2 className="text-xl font-bold mb-4">Appointment List</h2>
            <table className="min-w-full bg-white">
                <thead>
                    <tr>
                        <th className="py-2 px-4 border">Doctor</th>
                        <th className="py-2 px-4 border">Phone</th>
                        <th className="py-2 px-4 border">Email</th>
                        <th className="py-2 px-4 border">Reason</th>
                    </tr>
                </thead>
                <tbody>
                    {appointments.map((appt) => (
                        <tr key={appt.id}>
                            <td className="py-2 px-4 border">{appt.doctor.name}</td>
                            <td className="py-2 px-4 border">{appt.phone}</td>
                            <td className="py-2 px-4 border">{appt.email}</td>
                            <td className="py-2 px-4 border">{appt.reason}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AppointmentList;
